import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { FiTarget, FiUser, FiBookOpen, FiAward } from 'react-icons/fi';

const AboutContainer = styled.section`
  min-height: 100vh;
  padding: 120px 20px 60px;
  background: ${props => props.theme.background};
`;

const AboutContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
`;

const AboutHeader = styled(motion.div)`
  text-align: center;
  margin-bottom: 4rem;
`;

const AboutTitle = styled.h1`
  font-size: clamp(2.5rem, 5vw, 4rem);
  font-weight: 700;
  background: linear-gradient(-45deg, ${props => props.theme.primary}, ${props => props.theme.secondary}, ${props => props.theme.accent});
  background-size: 400% 400%;
  animation: gradient 3s ease infinite;
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
  margin-bottom: 1rem;
`;

const AboutSubtitle = styled.p`
  font-size: 1.2rem;
  color: ${props => props.theme.textSecondary};
  max-width: 600px;
  margin: 0 auto;
  line-height: 1.6;
`;

const AboutGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 2rem;
`;

const AboutSection = styled(motion.div)`
  background: ${props => props.theme.surface};
  border: 1px solid ${props => props.theme.border};
  border-radius: 20px;
  padding: 2rem;
  box-shadow: 0 10px 30px ${props => props.theme.shadow};
`;

const SectionIcon = styled.div`
  width: 50px;
  height: 50px;
  border-radius: 50%;
  background: linear-gradient(135deg, ${props => props.theme.primary}, ${props => props.theme.secondary});
  display: flex;
  align-items: center;
  justify-content: center;
  color: white;
  font-size: 1.5rem;
  margin-bottom: 1rem;
`;

const SectionTitle = styled.h2`
  font-size: 1.5rem;
  color: ${props => props.theme.text};
  margin-bottom: 1rem;
  font-weight: 600;
`;

const SectionContent = styled.div`
  color: ${props => props.theme.textSecondary};
  line-height: 1.7;
  font-size: 1rem;
`;

const About = ({ theme }) => {
  return (
    <AboutContainer theme={theme}>
      <AboutContent>
        <AboutHeader
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
        >
          <AboutTitle theme={theme}>About Me</AboutTitle>
          <AboutSubtitle theme={theme}>
            Data Analyst & Full Stack Developer passionate about AI-driven solutions and evidence-based policymaking
          </AboutSubtitle>
        </AboutHeader>

        <AboutGrid>
          <AboutSection
            initial={{ opacity: 0, x: -30 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.6, delay: 0.2 }}
            theme={theme}
          >
            <SectionIcon theme={theme}>
              <FiUser />
            </SectionIcon>
            <SectionTitle theme={theme}>Who I Am</SectionTitle>
            <SectionContent theme={theme}>
              I'm an analytical Data Analyst and Software Developer based in Ontario, Canada, with expertise in socio-economic modeling, 
              forecasting, and large-scale data processing. Currently working at Intact Insurance, I specialize in developing 
              AI-driven automation solutions and scalable backend services. My passion lies in creating actionable insights 
              for evidence-based decision making through advanced analytics and machine learning.
            </SectionContent>
          </AboutSection>

          <AboutSection
            initial={{ opacity: 0, x: 30 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.6, delay: 0.4 }}
            theme={theme}
          >
            <SectionIcon theme={theme}>
              <FiTarget />
            </SectionIcon>
            <SectionTitle theme={theme}>My Mission</SectionTitle>
            <SectionContent theme={theme}>
              To leverage cutting-edge technology and data science to solve complex business challenges. I'm committed to 
              developing scalable solutions that drive efficiency, improve decision-making processes, and create meaningful 
              impact through innovative AI and machine learning applications.
            </SectionContent>
          </AboutSection>

          <AboutSection
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.6 }}
            theme={theme}
          >
            <SectionIcon theme={theme}>
              <FiBookOpen />
            </SectionIcon>
            <SectionTitle theme={theme}>Education</SectionTitle>
            <SectionContent theme={theme}>
              <strong>Master's in Computer Science with AI Specialization</strong><br/>
              Western University, London (4.0 GPA)<br/>
              <strong>B.Tech in Computer Science (with Honors)</strong><br/>
              A.P.J. Abdul Kalam Technical University
            </SectionContent>
          </AboutSection>

          <AboutSection
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.8 }}
            theme={theme}
          >
            <SectionIcon theme={theme}>
              <FiAward />
            </SectionIcon>
            <SectionTitle theme={theme}>Certifications & Awards</SectionTitle>
            <SectionContent theme={theme}>
              • AWS Certified Solution Architect (SAA-C03)<br/>
              • Machine Learning Specialization – Stanford University<br/>
              • Employee of the Year Award – TCS (2021)<br/>
              • First Prize – Techwiz (Inter-College AI Competition)
            </SectionContent>
          </AboutSection>
        </AboutGrid>
      </AboutContent>
    </AboutContainer>
  );
};

export default About;
